import React from "react";
import { Wrap } from "../styles/About";

function About() {
  return (
    <Wrap>
      <CenteredText>
        <Text>
          Tребало би да будете сигурни да се у средини текста не крије нека
          сакривена или срамотна порука ератори који се могу наћи на Интернету
          су направљени да понављају предход.
        </Text>
      </CenteredText>
    </Wrap>
  );
}

export default About;
